export default function category(id) {
  if (id === "หลักสูตร") {
    return "หลักสูตร";
  }
  const catagory = [
    "ความรู้เกี่ยวกับราชการไทยและการเป็นข้าราชการ",
    "การพัฒนากรอบความคิด (Mindset)",
    "ทักษะเชิงภาวะผู้นำ",
    "ความรู้ด้านการบริหารงานและทรัพยากรบุคคล",
    "กฎหมายและระเบียบราชการ",
    "ทักษะด้านภาษา",
    "ทักษะเชิงยุทธศาสตร์",
    "ทักษะการเขียนหนังสือราชการ",

  ];
  return catagory[id-1];
}
